(7, 15, 3, '"World Music - Global Sounds in Australia" Book Launch', '<p><strong>"World Music - Global Sounds in Australia" edited by Seth Jordan and published by UNSW Press is launched in October.</strong>&nbsp;Featuring extensive contributions by some of Australia''s most knowledgeable and respected music journalists, broadcasters and academics, including Cristina Dio, Bruce Elder, Paul Petran and Brent Clough, this vibrant new book explores the story of Australian-based performers and other individuals who have significantly contributed to the development of Australia''s world music scene. With chapters covering the musical sub-genres of European, Middle Eastern, Indigenous, Latin, African, Reggae and Asian cultures, and contemporary cross-cultural fusions, the book traces the evolution of these sounds from the early 80''s to the dynamic, burgeoning scene it is today.&nbsp;</p><p>Diorama principal <strong>Cristina Dio</strong> was commissioned to write the chapter on Latin music titled "What is Latin music? A journey through Latin American music in Australia."&nbsp;Angelica Cristina Dio is a Uruguayan-born, Sydney-based creative writer, filmmaker and music presenter. Her passion for world music first manifested itself in the founding of the print publication DIASPORA in 2000, which has morphed into a popular website, diaspora.com.au, with thousands of worldwide subscribers. In her various projects, Cristina has been able to work with some of the world''s most celebrated world music artists - as a presenter for the popular SBS TV series "Viva"; as director of the film documentary Cafe Carnivale; through her work as a music video producer/director; and as a publicist for prestigious venues such as the Sydney Opera House.</p><p>The book is available from www.newsouthbooks.com.au</p>', '<p><strong>"World Music - Global Sounds in Australia" edited by Seth Jordan and published by UNSW Press is launched in October.</strong>&nbsp;Featuring extensive contributions by some of Australia''s most knowledgeable and respected music journalists, broadcasters and academics, including Cristina Dio, Bruce Elder, Paul Petran and Brent Clough, this vibrant new book explores the story of Australian-based performers and other individuals who have significantly contributed to the development of Australia''s world music scene.', '', 1286595085, 1),
(3, 16, 3, 'Diology', '<p><span style="color: #333333; font-family: Verdana, Arial, Helvetica, sans-serif; line-height: 16px; font-size: 13px;">&nbsp;</span></p><div class="header" style="font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 13px; color: #333333; line-height: 1.25em; padding: 0px; margin: 0px;"><h2 class="me" style="font-family: ''Arial Unicode MS'', Arial, Helvetica, sans-serif; font-size: 18px; color: #000000; line-height: 1.25em; display: inline; font-weight: bold; padding: 0px; margin: 0px;">"ology"</h2>&ensp;</div><div class="body" style="font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 13px; color: #333333; line-height: 1.25em; margin-top: 0em; margin-right: 0px; margin-bottom: 0em; margin-left: 0em; padding: 0px;"><div class="pbk" style="font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 13px; color: #333333; line-height: 1.25em; padding-top: 15px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; margin: 0px;"><div class="luna-Ent" style="font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 1em; color: #333333; line-height: 1.25em; padding-top: 0px; padding-right: 0px; padding-bottom: 5px; padding-left: 3px; background-color: #ffffff; display: block; margin: 0px;"><span style="font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 13px; color: #333333; line-height: 1.25em; position: static; padding: 0px; margin: 0px;"><span style="font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 13px; color: #333333; line-height: 1.25em; position: static; padding: 0px; margin: 0px;">any</span>&nbsp;<span style="font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 13px; color: #333333; line-height: 1.25em; position: static; padding: 0px; margin: 0px;">science</span>&nbsp;<span style="font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 13px; color: #333333; line-height: 1.25em; position: static; padding: 0px; margin: 0px;">or</span>&nbsp;<span style="font-family: 