(19, 37, 3, 'Peter Gilmore''s Inspiration Series', '<p>We worked with star chef Peter Gilmore, master of the Modern Australian movement of nature based cuisine, on his suite of "Inspiration" videos showcasing his amazing, world class dishes. All works of art, the videos show the level of detail and inspiration required to present Australia''s number one menu.</p>', '<p>We worked with star chef Peter Gilmore, master of the Modern Australian movement of nature based cuisine, on his suite of "Inspiration" videos showcasing his amazing, world class dishes. All works of art, the videos show the level of detail and inspiration required to present Australia''s number one menu.</p>', '', 1289445913, 1),
