(35, 56, 3, 'Blogarama', '<p><strong>Welcome to the Diorama Blog space!</strong></p><p><span style="text-decoration: underline;">A new year and a fresh new look!<br /></span>[posted Dec 2010]</p><p>It''s great to be heading into the new year with a whole new website showcasing some of the amazing projects of the last couple of years! And it feels good to be settled into our fabulous office at Fox Studios Australia. Diorama HQ is situated in Unit 5 of the colourful Building 103, directly across from the massive Stage 7, a beautiful historic pavilion built in 1938 and now used as a production studio. Watch this space for regular posts on Diorama''s projects, news and interesting industry info.</p>', '<p><strong>Welcome to the Diorama Blog space!</strong></p><p><span style="text-decoration: underline;">A new year and a fresh new look!<br /></span>[posted Dec 2010]</p>', '', 1291177929, 1),
