(2, 73, 3, 'Montage Reel', '<table border="0" align="left"><tbody><tr><td colspan="2">&nbsp;<object width="640" height="385"><param name="movie" value="http://www.youtube.com/v/_KqOmmZ9XZs?fs=1&amp;hl=en_US" /><param name="allowFullScreen" value="true" /><param name="allowscriptaccess" value="always" /><embed type="application/x-shockwave-flash" width="640" height="385" src="http://www.youtube.com/v/_KqOmmZ9XZs?fs=1&amp;hl=en_US" allowfullscreen="true" allowscriptaccess="always"></embed></object></td></tr><tr><td colspan="2"><p>Our reel showcases just a few of the amazing projects we have worked on over the last few years from our huge portfolio of music videos, commercials, high end corporate communications, documentary, TV and film content. The projects featured have been produced by Diorama in collaboration with some of Australias most innovative and creative talent. &nbsp;It demonstrates the production value that can be achieved across all media formats on a variety of budgets. Much of our work has won awards and accolades and has been broadcast internationally.</p> <p>We work with our clients to conceptualise stunning content and campaigns that connect with their audiences, and we approach every project with passion, commitment and inspired pizzazz! And from our base at Fox Studios, we can facilitate production all over Australia.</p> <p>For more about what we do and how we do it, click on our <a title="Diology" target="_self">profile</a> page.</p></td></tr><tr><td colspan="2"><p><strong>Showreel Credits<br /></strong><em>(in alphabetical order)</em></p> <p>Caf Carnivale <em>Documentary (Directed by Cristina Dio for SBS TV)<br /></em>Comeback - Grinspoon <em>Music Video (Directed by Adam Callen/Produced by Cristina Dio for Universal Music)</em>Do It Again  Cassie Davis <em>Music Video</em> <em>(Directed by Toby Angwin/Co-Produced by Cristina Dio for Sony Music)<br /></em>Drive Away  The Sundance Kids <em>Music Video (Directed by Adam Callen/Produced by Cristina