(3, 75, 3, 'Diology', '<p><strong>About Diorama.</strong></p><p>Diorama was founded in 2010 in order to bring together a creative vision and comprehensive skill set informed by a decade of media production and marketing experience. Principal Cristina Dio has produced and directed hundreds of successful projects and media campaigns for high profile clients all over the world. &nbsp;Diorama operates from this deep knowledge base and reaches out to a vast network of media professionals to offer a powerful package of creative communication, high production values and technical expertise.&nbsp;</p><p><strong><br /></strong></p><p><span style="color: #333333; font-family: Verdana, Arial, Helvetica, sans-serif; line-height: 16px; font-size: 13px;">&nbsp;</span></p>', '<p><strong>About Diorama.</strong></p><p>Diorama was founded in 2010 in order to bring together a creative vision and comprehensive skill set informed by a decade of media production and marketing experience. Principal Cristina Dio has produced and directed hundreds of successful projects and media campaigns for high profile clients all over the world. &nbsp;Diorama operates from this deep knowledge base and reaches out to a vast network of media professionals to offer a powerful package of creative communication, high production values and technical expertise.&nbsp;</p>', '', 1291265389, 1),
