(35, 81, 1, 'Blogarama', '<p><strong><span style="text-decoration: underline;"><br /></span></strong></p> <p><span style="font-family: Verdana, sans-serif; font-size: 12px; color: #494949;"><strong>Welcome to the Diorama Blog space!</strong></span></p> <p><span>A new year and a fresh new look!</span> <br /><span>[posted Dec 2010]</span></p> <p><span>It''s great to be heading into the new year with a whole new website showcasing some of the amazing projects of the last couple of years! And it feels good to be settled into our fabulous office at Fox Studios Australia. Diorama HQ is situated in Unit 5 of the colourful Building 103, directly across from the massive Stage 7, a beautiful historic pavilion built in 1938 and now used as a production studio. Watch this space for regular posts on Diorama''s projects, news and interesting industry info.</span></p>', '<p><strong><span style="text-decoration: underline;"><br /></span></strong></p> <p><span style="font-family: Verdana, sans-serif; font-size: 12px; color: #494949;"><strong>Welcome to the Diorama Blog space!</strong></span></p> <p><span>A new year and a fresh new look!</span> <br /><span>[posted Dec 2010]</span></p>', 'Removing table markup to test formatting bug fix', 1291293304, 1),
(3, 82, 3, 'Diorama Services.', '<p><strong>About Diorama.</strong></p><p>Diorama was founded in 2010 in order to bring together a creative vision and comprehensive skill set informed by a decade of media production and marketing experience. Principal Cristina Dio has produced and directed hundreds of successful projects and media campaigns for high profile clients all over the world. &nbsp;Diorama operates from this deep knowledge base and reaches out to a vast network of media professionals to offer a powerful package of creative communication, high production values and technical expertise.</p> <p><strong>Creative Ideas. <br /> </strong>Everything begins with an idea, and the teams who come together on Diorama projects work best from the ground up, or more accurately, from the sky down. We love ideas, and really believe that if you can dream it, it can be created. Our job is to offer solutions to turn your vision into reality. We help you get to the heart of your story and find the highlights that will resonate and connect emotionally with your audience. We strongly believe in concept-driven communication that will inspire your audience to act. Diorama draws from a network of professional and published writers with extensive experience in advertising, factual documentary, comedy, drama, popular &amp; street press, and genre.</p> <p><strong>Production.<br /> </strong>From virals for online social environments, to high-end corporate communications, big budget brand campaigns and world-class music videos, Diorama collaborates with award winning creatives to conceptualise, produce and deliver stunning content across all media platforms. We have also worked with every film and digital format possible and can achieve high production values on any budget. Our production reel showcases work that has won awards and accolades and has been broadcast internationally. Take a look at our production reel for a preview, or browse our youtube channel for extended pieces.<strong>&nbsp;</strong></p> <p><strong>Multiplatform Marketing.</strong></p> <p>We work closely with our clients to devise powerful and engaging marketing collateral, and deliver it in surprising ways to the target audience base. Our turnkey service specialises in emerging technologies and engages with audiences form the broad mainstream across to niche multicultural markets. Our service extends to finding new marketing opportunities for your material from our extensive media database.</p> <p><strong>Locations &amp; Talent.</strong></p> <p>The word Australia conjures up sweeping natural vistas; rugged coastal beauty; ancient cultures and magic; sophisticated metropoleis and colourful ethnic enclaves.&nbsp; From our base at Fox Studios, we can access these wonderful locations and facilitate production anywhere across our great brown land. With almost a decade of production experience and knowledge, Diorama principal Cristina Dio has access to the most professional and passionate crews, and is connected to an incredibly diverse network of sparkling local talent. Australian actors are some of the worlds most talented and adventurous, informed from our burgeoning multicultural melting point. Contact us for the local knowledge on Australian locations and talent.</p><p><strong>Recent Case Studies.<br /> </strong>Visit our projects page for details on our most recent work.</p><p><strong><br /></strong></p><p><span style="color: #333333; font-family: Verdana, Arial, Helvetica, sans-serif; line-height: 16px; font-size: 13px;">&nbsp;</span></p>', '<p><strong>About Diorama.</strong></p><p>Diorama was founded in 2010 in order to bring together a creative vision and comprehensive skill set informed by a decade of media production and marketing experience. Principal Cristina Dio has produced and directed hundreds of successful projects and media campaigns for high profile clients all over the world. &nbsp;Diorama operates from this deep knowledge base and reaches out to a vast network of media professionals to offer a powerful package of creative communication, high production values and technical expertise.</p>', '', 1291356298, 1),
