(35, 84, 3, 'Blogarama.', '<p><strong>Welcome to the Diorama Blog space!</strong></p> <p><span>A new year and a fresh new look!</span> <br /><span>[posted Dec 2010]</span></p> <p><span>It''s great to be heading into the new year with a whole new website showcasing some of the amazing projects of the last couple of years! And it feels good to be settled into our fabulous office at Fox Studios Australia. Diorama HQ is situated in Unit 5 of the colourful Building 103, directly across from the massive Stage 7, a beautiful historic pavilion built in 1938 and now used as a production studio. Watch this space for regular posts on Diorama''s projects, news and interesting industry info.</span></p>', '<p><strong>Welcome to the Diorama Blog space!</strong></p> <p><span>A new year and a fresh new look!</span> <br /><span>[posted Dec 2010]</span></p>', '', 1291356513, 1),
(3, 85, 3, 'Diorama Services.', '<p><strong>About Diorama.</strong></p><p>Diorama was founded in 2010 in order to bring together a creative vision and comprehensive skill set informed by a decade of media production and marketing experience. Principal Cristina Dio has produced and directed hundreds of successful projects and media campaigns for high profile clients all over the world. &nbsp;Diorama operates from this deep knowledge base and reaches out to a vast network of media professionals to offer a powerful package of creative communication, high production values and technical expertise.</p> <p><strong>Creative Ideas. <br /> </strong>Everything begins with an idea, and the teams who come together on Diorama projects work best from the ground up, or more accurately, from the sky down. We love ideas, and really believe that if you can dream it, it can be created. Our job is to offer solutions to turn your vision into reality. We help you get to the heart of your story and find the highlights that will resonate and connect emotionally with your audience. We strongly believe in concept-driven communication that will inspire your audience to act. Diorama draws from a network of professional and published writers with extensive experience in advertising, factual news, comedy, drama, special interest, street press, and genre.</p> <p><strong>Production.<br /> </strong>From virals for online social environments, to high-end corporate communications, big budget brand campaigns and world-class music videos, Diorama collaborates with award winning creatives to conceptualise, produce and deliver stunning content across all media platforms. We have also worked with every film and digital format possible and can achieve high production values on any budget. Our production reel showcases work that has won awards and accolades and has been broadcast internationally. Take a look at our production reel for a preview, or browse our youtube channel for extended pieces.<strong>&nbsp;</strong></p> <p><strong>Multiplatform Marketing.</strong></p> <p>We work closely with our clients to devise powerful and engaging marketing collateral, and deliver it in surprising ways to the target audience base. Our turnkey service specialises in emerging technologies and engages with audiences form the broad mainstream across to niche multicultural markets. Our service extends to finding new marketing opportunities for your material from our extensive media database.</p> <p><strong>Locations &amp; Talent.</strong></p> <p>The word Australia conjures up sweeping natural vistas; rugged coastal beauty; ancient cultures and magic; sophisticated metropoleis and colourful ethnic enclaves.&nbsp; From our base at Fox Studios, we can access these wonderful locations and facilitate production anywhere across our great brown land. With almost a decade of production experience and knowledge, Diorama principal Cristina Dio has access to the most professional and passionate crews, and is connected to an incredibly diverse network of sparkling local talent. Australian actors are some of the worlds most talented and adventurous, informed from our burgeoning multicultural melting point. Contact us for the local knowledge on Australian locations and talent.</p><p><strong>Recent Case Studies.<br /> </strong>Visit our projects page for details on our most recent work.</p><p><strong><br /></strong></p><p><span style="color: #333333; font-family: Verdana, Arial, Helvetica, sans-serif; line-height: 16px; font-size: 13px;">&nbsp;</span></p>', '<p><strong>About Diorama.</strong></p><p>Diorama was founded in 2010 in order to bring together a creative vision and comprehensive skill set informed by a decade of media production and marketing experience. Principal Cristina Dio has produced and directed hundreds of successful projects and media campaigns for high profile clients all over the world. &nbsp;Diorama operates from this deep knowledge base and reaches out to a vast network of media professionals to offer a powerful package of creative communication, high production values and technical expertise.</p>', '', 1291356617, 1),
(4, 86, 3, 'Location & Contacts.', '<p><strong>Diorama HQ<br /></strong>Unit 5, Building 103 Fox Studios Australia<br />38 Driver Avenue, Moore Park NSW 2021<br />+612 9383 4162<br />www.studiorama.com.au<br /><br /><strong>Postal<br /></strong>FSA 5&nbsp;<br />38 Driver Ave, Moore Park NSW<br />Australia 2021<br /><br /><strong>Cristina Dio<br /></strong>+61 414 323 452<br />cristina@studiorama.com.au<br /><br /><strong>Directions</strong><span style="text-decoration: underline;"><br /></span>Diorama HQ is situated inside the Professional Area of Fox Studios Australia, only 10 minutes from downtown Sydney CBD.&nbsp;The Fox lot is under 24 hour security so you need to call ahead prior to visiting.&nbsp;Enter via Security Gate D: Professional Entry, on 38 Driver Avenue, Moore Park and staff will instruct you on location and parking.&nbsp;</p><p><small><a style="color: #0000ff; text-align: left;" href="http://maps.google.com.au/maps?client=safari&amp;oe=UTF-8&amp;ie=UTF8&amp;q=fox+studios+australia&amp;fb=1&amp;gl=au&amp;hq=fox+studios+australia&amp;hnear=Sydney+New+South+Wales&amp;cid=0,0,16261554983133608730&amp;ei=sRL3TMulL4SurAejqtzvDw&amp;oi=local_result&amp;ved=0CCMQnwIwAQ&amp;ll=-33.891098,151.225176&amp;spn=0.006181,0.013711&amp;z=16&amp;iwloc=A&amp;source=embed" target="_blank">View Map</a></small></p><p><span style="font-family: Verdana, Arial, Helvetica, sans-serif; font-size: x-small;"><span style="font-size: 10px;"><br /></span></span><span style="font-size: x-small;"><span style="font-size: 10px;"><br /></span></span></p>', '<p><strong>Diorama HQ<br /></strong>Unit 5, Building 103 Fox Studios Australia<br />38 Driver Avenue, Moore Park NSW 2021<br />+612 9383 4162<br />www.studiorama.com.au<br /><br /><strong>Postal<br /></strong>FSA 5&nbsp;<br />38 Driver Ave, Moore Park NSW<br />Australia 2021<br /><br /><strong>Cristina Dio<br /></strong>+61 414 323 452<br />cristina@studiorama.com.au<br /><br /><strong>Directions</strong><span style="text-decoration: underline;">', '', 1291356764, 1),
(38, 87, 3, 'Inspiration Series featured on Gourmet Traveller', '<p>Our Inspiration Series videos are featured on Gourmet Traveller. Check them out on this <a href="http://gourmettraveller.com.au/video.htm?guid=a2c5b970-b658-4d59-ac74-91c75254e667" target="_blank">link</a>.</p>', '<p>Our Inspiration Series videos are featured on Gourmet Traveller. Check them out on this <a href="http://gourmettraveller.com.au/video.htm?guid=a2c5b970-b658-4d59-ac74-91c75254e667" target="_blank">link</a>.</p>', '', 1291358535, 1),
(38, 88, 3, 'Inspiration Series featured on Gourmet Traveller', '<p>Our Inspiration Series videos for star chef Peter Gilmore are now featured on Gourmet Traveller, showcasing the very pinnacle of Modern Australian cuisine. The now famous Snow Egg, which created a media frenzy as the final challenge of the 2010 Masterchef series, is just one of over a dozen vignettes in which Peter Gilmore talks us through the inspirations for his world-renowned signature dishes. &nbsp;Check them out on this <a href="http://gourmettraveller.com.au/video.htm?guid=a2c5b970-b658-4d59-ac74-91c75254e667" target="_blank">link</a>.</p>', '<p>Our Inspiration Series videos for star chef Peter Gilmore are now featured on Gourmet Traveller, showcasing the very pinnacle of Modern Australian cuisine. The now famous Snow Egg, which created a media frenzy as the final challenge of the 2010 Masterchef series, is just one of over a dozen vignettes in which Peter Gilmore talks us through the inspirations for his world-renowned signature dishes. &nbsp;Check them out on this <a href="http://gourmettraveller.com.au/video.htm?guid=a2c5b970-b658-4d59-ac74-91c75254e667" target="_blank">link</a>.</p>', '', 1291610947, 1),
(38, 89, 3, 'Inspiration Series featured on Gourmet Traveller.', '<p style="text-align: left;">Our Inspiration Series videos for star chef Peter Gilmore are now featured on Gourmet Traveller, showcasing the very pinnacle of Modern Australian cuisine. The now famous Snow Egg, which created a media frenzy as the final challenge of the 2010 Masterchef series, is just one of over a dozen vignettes in which Peter Gilmore talks us through the inspirations for his world-renowned signature dishes. The series is also featured on the Quay website, and collectively, the videos have scored over 40,000 views on Youtube. Check them out on the Gourmet Traveller site on this&nbsp;<a href="http://gourmettraveller.com.au/video.htm?guid=a2c5b970-b658-4d59-ac74-91c75254e667" target="_blank">link</a>, or&nbsp;find a sneak preview below.<br /><br />&nbsp;<object width="560" height="340"><param name="movie" value="http://www.youtube.com/v/suY70eXfKCI?fs=1&amp;hl=en_US&amp;color1=0x3a3a3a&amp;color2=0x999999" /><param name="allowFullScreen" value="true" /><param name="allowscriptaccess" value="always" /><embed type="application/x-shockwave-flash" width="560" height="340" src="http://www.youtube.com/v/suY70eXfKCI?fs=1&amp;hl=en_US&amp;color1=0x3a3a3a&amp;color2=0x999999" allowscriptaccess="always" allowfullscreen="true"></embed></object></p>', '<p style="text-align: left;">Our Inspiration Series videos for star chef Peter Gilmore are now featured on Gourmet Traveller, showcasing the very pinnacle of Modern Australian cuisine. The now famous Snow Egg, which created a media frenzy as the final challenge of the 2010 Masterchef series, is just one of over a dozen vignettes in which Peter Gilmore talks us through the inspirations for his world-renowned signature dishes. The series is also featured on the Quay website, and collectively, the videos have scored over 40,000 views on Youtube.', '', 1291611955, 1),
(38, 90, 3, 'Inspiration Series featured on Gourmet Traveller.', '<p style="text-align: left;">Our Inspiration Series videos for star chef Peter Gilmore are now featured on Gourmet Traveller, showcasing the highest pinnacle of Modern Australian cuisine. The now famous Snow Egg, which created a media frenzy as the final challenge of the 2010 Masterchef series, is just one of over a dozen world-renowned signature dishes that Peter Gilmore talks us through, revealing the inspirations for each, as well as a description of how the dish is created into the mouth-watering display that is served at Quay. The series is also featured on the Quay website, and collectively, the videos have scored over 40,000 views on Youtube. Check them out on the Gourmet Traveller site on this&nbsp;<a href="http://gourmettraveller.com.au/video.htm?guid=a2c5b970-b658-4d59-ac74-91c75254e667" target="_blank">link</a>, or&nbsp;find a sneak preview below.<br /><br />&nbsp;<object width="560" height="340"><param name="movie" value="http://www.youtube.com/v/suY70eXfKCI?fs=1&amp;hl=en_US&amp;color1=0x3a3a3a&amp;color2=0x999999" /><param name="allowFullScreen" value="true" /><param name="allowscriptaccess" value="always" /><embed type="application/x-shockwave-flash" width="560" height="340" src="http://www.youtube.com/v/suY70eXfKCI?fs=1&amp;hl=en_US&amp;color1=0x3a3a3a&amp;color2=0x999999" allowfullscreen="true" allowscriptaccess="always"></embed></object></p>', '<p style="text-align: left;">Our Inspiration Series videos for star chef Peter Gilmore are now featured on Gourmet Traveller, showcasing the highest pinnacle of Modern Australian cuisine. The now famous Snow Egg, which created a media frenzy as the final challenge of the 2010 Masterchef series, is just one of over a dozen world-renowned signature dishes that Peter Gilmore talks us through, revealing the inspirations for each, as well as a description of how the dish is created into the mouth-watering display that is served at Quay.', '', 1291612240, 1),
