(39, 92, 3, 'Welcome to our new website!', '<p><span>A new year and a fresh new look!</span>&nbsp;</p><p><span>It''s great to be heading into the new year with a whole new website showcasing some of the amazing projects of the last couple of years! And it feels good to be settled into our fabulous office at Fox Studios Australia. Diorama HQ is situated in Unit 5 of the colourful Building 103, directly across from the massive Stage 7, a beautiful historic pavilion built in 1938 and now used as a production studio. Watch this space for regular posts on Diorama''s projects, news and interesting industry info.</span></p>', '<p><span>A new year and a fresh new look!</span>&nbsp;</p><p><span>It''s great to be heading into the new year with a whole new website showcasing some of the amazing projects of the last couple of years! And it feels good to be settled into our fabulous office at Fox Studios Australia. Diorama HQ is situated in Unit 5 of the colourful Building 103, directly across from the massive Stage 7, a beautiful historic pavilion built in 1938 and now used as a production studio. Watch this space for regular posts on Diorama''s projects, news and interesting industry info.</span></p>', '', 1291614299, 1),
(11, 93, 3, '"World Music: Global Sounds in Australia" Book Launched', '<p><span style="color: #000000; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: x-small;"><span style="font-size: 10px;"><strong>"World Music: Global Sounds in Australia" edited by Seth Jordan&nbsp;is launched in Sydney &amp; Melbourne.<br /></strong>Australia''s first book about the impact of multicultural music on our ever-expanding culture, has just been launched in Sydney at Gleebooks; and in Melbourne at the Australasian World Music Expo. Commissioned by University of New South Wales Press, the book was edited by Seth Jordan and features twelve specialist writers each contributing a chapter each on a specific genre of "world music." Cristina Dio was invited to write a chapter on Latin music in Australia since its arrival in the 1970s. She is joined by some of Australia''s most informed and popular presenters and writers of music, including Bruce Elder, Paul Petran and Brent Clough.&nbsp;</span></span></p><p><span style="color: #000000; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: x-small;"><span style="font-size: 10px;"><strong>Official Press Release</strong><br />World Music: Global Sounds in Australia - edited by Seth Jordan.<br />From its early beginnings in the 1980s, the vibrant world music genre in Australia has burgeoned to become the dynamic scene it is today. World Music charts this evolution, with chapter contributions from some of Australia''s most knowledgeable and respected world music journalists, broadcasters, academics and promoters, and in doing so provides an historical perspective on one of music''s most exciting styles. It explores the story of Australian-based performers and other individuals who have significantly contributed to the development of Australia''s world music scene. With chapters covering many musical sub-genres: European, African, Latin, Reggae, Asian, Middle Eastern, Indigenous and contemporary cross-cultural fusions - attention is given to the communities, organisations, venues and festivals, along with the various media outlets that have promoted world music in Australia.<br /><br />The book is available online at <a href="http://www.unswpress.com.au" target="_blank">www.unswpress.com.au</a></span></span></p><p><span style="color: #000000; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: x-small;"><span style="font-size: 10px;">&nbsp;</span></span></p>', '<p><span style="color: #000000; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: x-small;"><span style="font-size: 10px;"><strong>"World Music: Global Sounds in Australia" edited by Seth Jordan&nbsp;is launched in Sydney &amp; Melbourne.', '', 1291617130, 1),
(5, 94, 3, 'Welcome to our brand new website!', '<p>Browse around our new site and get acquainted with what we do and how we do it. The Montage page features our production reel and credits, while a visit to the Diology section will give you more detailed information on our various services. Blogarama is the blog space with up to the minute musings and quick updates in a rolling chronology of life in the Diorama universe. Connect with our social sites too, for immediate behind-the-scenes postings, or to drop us a casual line or two. For more information or if you just feel like a chat about Australian production, marketing, locations or talent, call Cristina Dio during business hours (9-5pm AEST) on +612 9383 4162 or email cristina@studiorama.com.au</p>', '<p>Browse around our new site and get acquainted with what we do and how we do it. The Montage page features our production reel and credits, while a visit to the Diology section will give you more detailed information on our various services. Blogarama is the blog space with up to the minute musings and quick updates in a rolling chronology of life in the Diorama universe. Connect with our social sites too, for immediate behind-the-scenes postings, or to drop us a casual line or two.', '', 1291618463, 1),
(2, 95, 1, 'Production Reel.', '<p><object width="640" height="385"><param name="movie" value="http://www.youtube.com/v/_KqOmmZ9XZs?fs=1&amp;hl=en_US" /><param name="allowFullScreen" value="true" /><param name="allowscriptaccess" value="always" /><embed type="application/x-shockwave-flash" width="640" height="385" src="http://www.youtube.com/v/_KqOmmZ9XZs?fs=1&amp;hl=en_US" allowfullscreen="true" allowscriptaccess="always"></embed></object></p> <p>Our reel showcases just a few of the amazing projects we have worked on over the last few years from our huge portfolio of music videos, commercials, high end corporate communications, documentary, TV and film content. The projects featured have been produced by Diorama in collaboration with some of Australias most innovative and creative talent. &nbsp;It demonstrates the production value that can be achieved across all media formats on a variety of budgets. Much of our work has won awards and accolades and has been broadcast internationally.</p> <p>We work with our clients to conceptualise stunning content and campaigns that connect with their audiences, and we approach every project with passion, commitment and inspired pizzazz! And from our base at Fox Studios, we can facilitate production all over Australia.</p> <p>For more about what we do and how we do it, click on our <a title="Diology" target="_self">profile</a> page.</p><p><strong>Showreel Credits<br /></strong><em>(in alphabetical order)<br /></em></p><p>Caf Carnivale <em>Documentary (Directed by Cristina Dio for SBS TV)<br /></em>Comeback - Grinspoon <em>Music Video (Directed by Adam Callen/Produced by Cristina Dio for Universal Music)<br /></em>Do It Again  Cassie Davis <em>Music Video</em> <em>(Directed by Toby Angwin/Co-Produced by Cristina Dio for Sony Music)<br /></em>Drive Away  The Sundance Kids <em>Music Video (Directed by Adam Callen/Produced by Cristina Dio for Warner Music)<br /></em>Friend  Lowrider <em>Music Video (Directed by Matt Bird/Produced by 