en_US" allowfullscreen="true" allowscriptaccess="always"></embed></object></p>', '', 1291669701, 1),
(2, 98, 3, 'Production Reel.', '<p style="text-align: right;"><object width="640" height="385"><param name="movie" value="http://www.youtube.com/v/_KqOmmZ9XZs?fs=1&amp;hl=en_US" /><param name="allowFullScreen" value="true" /><param name="allowscriptaccess" value="always" /><embed type="application/x-shockwave-flash" width="640" height="385" src="http://www.youtube.com/v/_KqOmmZ9XZs?fs=1&amp;hl=en_US" allowscriptaccess="always" allowfullscreen="true"></embed></object></p> <p>________________________________________________________________________________________________________________________<br />Our reel showcases just a few of the amazing projects we have worked on over the last few years from our huge portfolio of music videos, commercials, high end corporate communications, documentary, TV and film content. The projects featured have been produced by Diorama in collaboration with some of Australias most innovative and creative talent. &nbsp;It demonstrates the production value that can be achieved across all media formats on a variety of budgets. Much of our work has won awards and accolades and has been broadcast internationally.</p><p>We work with our clients to conceptualise stunning content and campaigns that connect with their audiences, and we approach every project with passion, commitment and inspired pizzazz! And from our base at Fox Studios, we can facilitate production all over Australia.</p> <p>For more about what we do and how we do it, click on our <a title="Diology" target="_self">profile</a> page.</p><p><strong>Showreel Credits<br /></strong><em>(in alphabetical order)<br /></em></p><p>Caf Carnivale <em>Documentary (Directed by Cristina Dio for SBS TV)<br /></em>Comeback - Grinspoon <em>Music Video (Directed by Adam Callen/Produced by Cristina Dio for Universal Music)<br /></em>Do It Again  Cassie Davis <em>Music Video</em> <em>(Directed by Toby Angwin/Co-Produced by Cristina Dio for Sony Music)<br /></em>Drive Away  The Sundance Kids <em>Music Video (Directed by Adam Callen/Produced by Cristina Dio for Warner Music)<br /></em>Friend  Lowrider <em>Music Video (Directed by Matt Bird/Produced by Cristina Dio for Liberation Music)<br /></em>Inspiration Series by Chef Peter Gilmore <em>Video Series (Directed by Cristina Dio for QRA Australia)<br /></em>Kbar Chway  Darine Hadchiti <em>Music Video (Directed by Jad Haber/Produced by Cristina Dio for EMI Arabia)<br /></em>Liberty  ResMed International Campaign <em>Video Series (Directed by Matt Bird/Produced by Cristina Dio for ResMed/Flicks Australia)<br /></em>Lonely  Paris Wells <em>Music Video (Directed by Matt Bird/Produced by Cristina Dio for Liberation Music)<br /></em>Otto  Media Campaign <em>Video Series (Directed by Cristina Dio for Fink Group Australia)<br /></em>Point Zero  Youth Week Video <em>(Directed by Cristina Dio for Point Zero Services)<br /></em>Quay  Media Campaign <em>Video Series (Directed by Cristina Dio for Fink Group Australia)<br /></em>Rise to the Festival  Declan Kelly <em>Music Video (Directed by Cristina Dio for Vitamin Records)<br /></em>The Crossing  Feature Film Trailer <em>(Directed by Matt Bird/Produced by Cristina Dio)<br /></em>The Sea is Rising  Bliss N Eso <em>Music Video (Directed by Matt Bird/Produced by Cristina Dio for Illusive Sounds)<br /></em>Then Til Now  Bliss N Eso <em>Music Video (Directed by Matt Bird/Produced by Cristina Dio for Illusive Sounds)<br /></em>Viva  13 part doco series <em>(Eps 1-4 Presented/Co-produced by Cristina Dio/Produced by James Ricketson for SBS TV)<br /></em>Woodstock 2008 - Bliss N Eso <em>Music Video (Directed by Matt Bird/Produced by Cristina Dio for Illusive Sounds)<br /></em>Woodys Liquid Kitchen  Pilot Episode <em>(Directed by Agostino Marcello/Produced by Cristina Dio for Drink Australia)</em></p>', '<p style="text-align: right;"><object width="640" height="385"><param name="movie" value="http://www.youtube.com/v/_KqOmmZ9XZs?fs=1&amp;hl=en_US" /><param name="allowFullScreen" value="true" /><param name="allowscriptaccess" value="always" /><embed type="application/x-shockwave-flash" width="640" height="385" src="http://www.youtube.com/v/_KqOmmZ9XZs?fs=1&amp;hl=en_US" allowscriptaccess="always" allowfullscreen="true"></embed></object></p>', '', 1291704579, 1),
(1, 99, 3, 'Diorama', '<p><strong>Creative Communication</strong><br />Based at Fox Studios Australia, Diorama is a hybrid, multi-platform production and marketing agency in the business of creating amazing content and media campaigns across a variety of formats and budgets. Principal Cristina Dio has over ten years experience in production and marketing and is available for consultation on +61 2 9383 4162.</p>', '<p><strong>Creative Communication</strong><br />Based at Fox Studios Australia, Diorama is a hybrid, multi-platform production and marketing agency in the business of creating amazing content and media campaigns across a variety of formats and budgets. Principal Cristina Dio has over ten years experience in production and marketing and is available for consultation on +61 2 9383 4162.</p>', '', 1291804763, 1),
(12, 100, 3, 'Australian Chamber Orchestra', '<p>Working with MOD Films, we assisted in the production shoot of the ACO''s star quartet in a pilot for an interactive 3D installation. Directed by award-winning digital artist Michela Ledwidge, the ACO quartet were filmed and recorded at Sydney''s Trackdown studios, by the iCinema 3D camera system.</p>', '<p>Working with MOD Films, we assisted in the production shoot of the ACO''s star quartet in a pilot for an interactive 3D installation. Directed by award-winning digital artist Michela Ledwidge, the ACO quartet were filmed and recorded at Sydney''s Trackdown studios, by the iCinema 3D camera system.</p>', '', 1292298702, 1),
(6, 101, 3, 'Otto Ristorante', '<p>We designed a suite of beautiful digital tours of the Fink Group''s stunning waterside function spaces, including the Terrazzo at Woolloomooloo Wharf (pictured).&nbsp;</p>', '<p>We designed a suite of beautiful digital tours of the Fink Group''s stunning waterside function spaces, including the Terrazzo at Woolloomooloo Wharf (pictured).&nbsp;</p>', '', 1292307707, 1),
(19, 102, 3, 'Peter Gilmore''s Inspiration Series', '<p>We worked with star chef Peter Gilmore, master of the Modern Australian movement of nature based cuisine, on his suite of "Inspiration" videos showcasing his amazing, world class dishes. All works of art, the videos show the level of detail and inspiration required to present Australia''s number one menu.</p>', '<p>We worked with star chef Peter Gilmore, master of the Modern Australian movement of nature based cuisine, on his suite of "Inspiration" videos showcasing his amazing, world class dishes. All works of art, the videos show the level of detail and inspiration required to present Australia''s number one menu.</p>', '', 1292462972, 1),
(40, 103, 3, 'Diaspora Worldbeat Website', '<p>We are currently working on the production and launch of Australia''s only worldbeat website, Diaspora, one of the most comprehensive world music resources on the internet. Celebrating ten years of providing informed and entertaining music stories, reviews, interviews and tour news, Diaspora will be re-launched in early 2011 with a whole new look and functionality.&nbsp;</p>', '<p>We are currently working on the production and launch of Australia''s only worldbeat website, Diaspora, one of the most comprehensive world music resources on the internet. Celebrating ten years of providing informed and entertaining music stories, reviews, interviews and tour news, Diaspora will be re-launched in early 2011 with a whole new look and functionality.&nbsp;</p>', '', 1292465020, 1),
(38, 104, 3, 'Inspiration Series featured on Gourmet Traveller.', '<p style="text-align: left;">Our Inspiration Series videos for star chef Peter Gilmore are now featured on Gourmet Traveller, showcasing the highest pinnacle of Modern Australian cuisine. The now famous Snow Egg, which created a media frenzy as the final challenge of the 2010 Masterchef series, is just one of over a dozen world-renowned signature dishes that Peter Gilmore talks us through, revealing the inspirations for each, as well as a description of how the dish is created into the mouth-watering display that is served at Quay. The series is also featured on the Quay website, and collectively, the videos have scored over 40,000 views on Youtube. Check them out on the Gourmet Traveller site on this&nbsp;<a href="http://gourmettraveller.com.au/video.htm?guid=a2c5b970-b658-4d59-ac74-91c75254e667" target="_blank">link</a>, or&nbsp;find a sneak preview below.<br /><br />&nbsp;<object width="560" height="340"><param name="movie" value="http://www.youtube.com/v/suY70eXfKCI?fs=1&amp;hl=en_US&amp;color1=0x3a3a3a&amp;color2=0x999999" /><param name="allowFullScreen" value="true" /><param name="allowscriptaccess" value="always" /><embed type="application/x-shockwave-flash" width="560" height="340" src="http://www.youtube.com/v/suY70eXfKCI?fs=1&amp;hl=en_US&amp;color1=0x3a3a3a&amp;color2=0x999999" allowscriptaccess="always" allowfullscreen="true"></embed></object></p>', '<p style="text-align: left;">Our Inspiration Series videos for star chef Peter Gilmore are now featured on Gourmet Traveller, showcasing the highest pinnacle of Modern Australian cuisine. The now famous Snow Egg, which created a media frenzy as the final challenge of the 2010 Masterchef series, is just one of over a dozen world-renowned signature dishes that Peter Gilmore talks us through, revealing the inspirations for each, as well as a description of how the dish is created into the mouth-watering display that is served at Quay.', '', 1292549309, 1);
