(7, 'node', '  world music global sounds in australia book launch  world music global sounds in australia edited by seth jordan and published by unsw press is launched in october  featuring extensive contributions by some of australia s most knowledgeable and respected music journalists broadcasters and academics including cristina dio bruce elder paul petran and brent clough this vibrant new book explores the story of australianbased performers and other individuals who have significantly contributed to the development of australia s world music scene with chapters covering the musical subgenres of european middle eastern indigenous latin african reggae and asian cultures and contemporary crosscultural fusions the book traces the evolution of these sounds from the early 80 s to the dynamic burgeoning scene it is today diorama principal cristina dio was commissioned to write the chapter on latin music titled what is latin music a journey through latin american music in australia angelica cristina dio is a uruguayanborn sydneybased creative writer filmmaker and music presenter her passion for world music first manifested itself in the founding of the print publication diaspora in 2000 which has morphed into a popular website diasporacomau with thousands of worldwide subscribers in her various projects cristina has been able to work with some of the world s most celebrated world music artists as a presenter for the popular sbs tv series viva as director of the film documentary cafe carnivale through her work as a music video producer director and as a publicist for prestigious venues such as the sydney opera housethe book is available from wwwnewsouthbookscomau ', 0),
(8, 'node', ' otto ristorante ', 0);
